import React, { createContext } from "react";
import ComA from './comA';

const fName = createContext();
const lName = createContext();

const App = () => {
    return (
    <>
    <fName.Provider value={'sarik'}>
    <lName.Provider value={'Yadav'}>
    <ComA />
    </lName.Provider>
    </fName.Provider>
    </>
    
    );
}

export default App;
export {fName};
